        navigation.openDrawer();
   }
    return(
        <View style={styles.header}>
            <MaterialIcons name='menu' size={28} onPress={openMenu} style={styles.icon}/>
            <View>
                <Text style={styles.headerText}>Setram</Text>
            </View>
        </View>
    );
}
